E_D("DROP TABLE IF EXISTS `go_shoplist`;");
E_C("CREATE TABLE `go_shoplist` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品id',
  `sid` int(10) unsigned NOT NULL COMMENT '同一个商品',
  `cateid` smallint(6) unsigned DEFAULT NULL COMMENT '所属栏目ID',
  `brandid` smallint(6) unsigned DEFAULT NULL COMMENT '所属品牌ID',
  `title` varchar(100) DEFAULT NULL COMMENT '商品标题',
  `title_style` varchar(100) DEFAULT NULL,
  `title2` varchar(100) DEFAULT NULL COMMENT '副标题',
  `keywords` varchar(100) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '金额',
  `yunjiage` decimal(4,2) unsigned DEFAULT '1.00' COMMENT '云购人次价格',
  `zongrenshu` int(10) unsigned DEFAULT '0' COMMENT '总需人数',
  `canyurenshu` int(10) unsigned DEFAULT '0' COMMENT '已参与人数',
  `shenyurenshu` int(10) unsigned DEFAULT NULL,
  `def_renshu` int(10) unsigned DEFAULT '0',
  `qishu` smallint(6) unsigned DEFAULT '0' COMMENT '期数',
  `maxqishu` smallint(5) unsigned DEFAULT '1' COMMENT ' 最大期数',
  `thumb` varchar(255) DEFAULT NULL,
  `picarr` text COMMENT '商品图片',
  `content` mediumtext COMMENT '商品内容详情',
  `codes_table` char(20) DEFAULT NULL,
  `xsjx_time` int(10) unsigned DEFAULT NULL,
  `pos` tinyint(4) unsigned DEFAULT NULL COMMENT '是否推荐',
  `renqi` tinyint(4) unsigned DEFAULT '0' COMMENT '是否人气商品0否1是',
  `time` int(10) unsigned DEFAULT NULL COMMENT '时间',
  `order` int(10) unsigned DEFAULT '1',
  `q_uid` int(10) unsigned DEFAULT NULL COMMENT '中奖人ID',
  `q_user` text NOT NULL COMMENT '中奖人信息',
  `q_user_code` char(20) DEFAULT NULL COMMENT '中奖码',
  `q_content` mediumtext COMMENT '揭晓内容',
  `q_counttime` char(20) DEFAULT NULL COMMENT '总时间相加',
  `q_end_time` char(20) DEFAULT NULL COMMENT '揭晓时间',
  `q_showtime` char(1) DEFAULT 'N' COMMENT 'Y/N揭晓动画',
  `zhiding` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '指定中奖人',
  PRIMARY KEY (`id`),
  KEY `renqi` (`renqi`),
  KEY `order` (`yunjiage`),
  KEY `q_uid` (`q_uid`),
  KEY `sid` (`sid`),
  KEY `shenyurenshu` (`shenyurenshu`),
  KEY `q_showtime` (`q_showtime`)
) ENGINE=InnoDB AUTO_INCREMENT=257 DEFAULT CHARSET=utf8 COMMENT='商品表'");
E_D("replace into `go_shoplist` values('1','2','13','15','苹果（Apple）iMac ME086CH/A 21.5英寸一体电脑','color:#FF0000;','全新iMac采用全新第四代Intel处理器，采用IPS和LED背光技术让屏幕随开即用，边缘仅薄至5毫米，如此出色的台式电脑，才配得上你的桌面！','电脑苹果电脑','全新iMac采用全新第四代Intel处理器，采用IPS和LED背光技术让屏幕随开即用，边缘仅薄至5毫米，如此出色的台式电脑，才配得上你的桌面！','564.00','1.00','564','564','0','0','1','100','shopimg/20150822/16000221176436.jpg','a:3:{i:0;s:35:\"shopimg/20150822/55872529176442.jpg\";i:1;s:35:\"shopimg/20150822/62575000176451.jpg\";i:2;s:35:\"shopimg/20150822/61674310176451.jpg\";}','<p>	</p><p>	</p><p style=\"font-size:45px; line-height:55px; text-align:center; padding-top:10px; margin:0px; letter-spacing:3px;\">	一见动容，一用动心。</p><p>	</p><p style=\"font-size:16px; line-height:22px;text-align:center; padding-top:20px; margin:0px; letter-spacing:1px; \">	从夺目的大显示屏、第四代 Intel Core 处理器，到强劲的图形处理器</p><p>	</p><p style=\"font-size:16px; line-height:22px;text-align:center; padding-top:3px; margin:0px; letter-spacing:1px;\">	和领先的 Fusion Drive 存储选配，动人之处多不胜数。如此出色的</p><p>	</p><p style=\"font-size:16px; line-height:22px;text-align:center; padding-top:3px; margin:0px; letter-spacing:1px;\">	台式电脑，才配得上你的桌面。</p><p>	</p><p style=\"padding:20px 0px 10px 0px; margin:0px; text-align:center;\">	<img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140709172623126.jpg\"/></p><p>	</p><p>	</p><p>	</p><p style=\"font-size:45px; line-height:55px; text-align:center; padding:50px 0px 0px 150px; margin:0px; letter-spacing:3px;\">	超大 LED 背光宽显示屏，<br/>	悦目，瞩目。</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:120px 0px 0px 450px; margin:0px; letter-spacing:3px;\">	创新处处现</p><p>	</p><p style=\"font-size:14px; line-height:22px; padding:10px 0px 0px 450px; margin:0px; width:330px; text-indent:28px;\">	面对宽大亮丽的 21.5 和 27 英寸显示屏，沉浸其中的你不希望有任何事情分散注意力。 而现在，也的确没有什么能影响你，因为令人瞩目的显示屏设计减少了反射光，且 LCD 屏紧贴保护玻璃，让你眼前的画面跃然屏上。</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:60px 0px 0px 450px; margin:0px; letter-spacing:3px;\">	IPS 技术和 LED 背光</p><p>	</p><p style=\"font-size:14px; line-height:22px; padding:10px 0px 0px 450px; margin:0px; width:330px; text-indent:28px;\">	无论从哪个角度看，亮丽的 iMac 显示屏效果都极为出色。 因为它采用了一项称为板内切换 (IPS)\n的技术，使屏幕从几乎任何角度看，都能呈现出色彩出众的亮丽画面。 LED\n背光技术还让屏幕可以随开即用，无需等待就能立刻亮度均匀。你随时都可以与家人分享假期的精彩幻灯片。</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:60px 0px 0px 450px; margin:0px; letter-spacing:3px;\">	鲜活色彩，时时活灵活现。</p><p>	</p><p style=\"font-size:14px; line-height:22px; padding:10px 0px 0px 450px; margin:0px; width:330px; text-indent:28px;\">	你在宽大亮丽的屏幕上所见的一切，无论是肤色影调、暗部阴影， 还是湛蓝天空和绿色田野，都色彩丰富鲜艳，真实还原，更栩栩如生。 因每台 iMac 显示屏都使用先进的光谱辐射仪逐一进行了色彩校准，以符合世界公认的各种颜色标准。</p><p>	</p><p>	</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:180px 0px 0px 10px; margin:0px; letter-spacing:3px;\">	全新 Intel Core 处理器，<br/>	四核，激发无限可能。</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:15px 0px 0px 10px; margin:0px; width:370px; text-indent:28px;\">	第四代 Intel Core 处理器的强大动力，成就了这款 iMac 的超快速度。 其系列中的每款机型都标配 Intel Core i5\n处理器，频率最高可达 3.4GHz。你还可以在 Apple Store 在线商店为你的 iMac 配置性能更强劲的 Intel Core i7\n处理器，频率最高可达 3.5GHz。</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:160px 0px 0px 10px; margin:0px; letter-spacing:3px;\">	疾速流畅的图形处理器，<br/>	强劲性能，夺目表现。</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:15px 0px 0px 10px; margin:0px; width:330px; text-indent:28px;\">	iMac 全系列产品均拥有强劲的图形处理性能。 无论你选择快速的 Intel HD Graphics 5000 图形处理器，更快的\nIntel Iris Pro Graphics 图形处理器， 还是速度惊人的 NVIDIA 独立图形处理器，都会体验到比以往更快速、更流畅的\n3D 游戏和 HD 高清视频。</p><p>	</p><p>	</p><p>	</p><p style=\"font-size:45px; line-height:65px; text-align:center; padding:50px 0px 0px 0px; margin:0px; letter-spacing:3px;\">	端口和连接，<br/>	多元化高速 I/O 传输。</p><p>	</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:120px 0px 0px 10px; margin:0px; letter-spacing:3px;\">	Thunderbolt</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:15px 0px 0px 10px; margin:0px; width:350px; text-indent:28px;\">	小巧的 Thunderbolt 端口具有超快、超灵活的特点，并提供惊人的疾速传输和多样化扩展能力。\n不仅能连接外置驱动器、摄像头、音频和视频采集设备等高性能外设，还可以连接 Mini DisplayPort 显示器获得更大的屏幕空间。所有\niMac 机型都配有两个 Thunderbolt 端口，让你打造无所不能的终极桌面电脑。</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:125px 0px 0px 10px; margin:0px; letter-spacing:3px;\">	802.11ac Wi-Fi</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:15px 0px 0px 10px; margin:0px; width:350px; text-indent:28px;\">	iMac 支持疾速 802.11ac Wi-Fi 网络。 接入 802.11ac 基站，如 AirPort Extreme 和 AirPort Time Capsule，你可体验快达 3 倍的无线性能3。同时你的 Wi-Fi 网络覆盖范围也会扩大。</p><p>	</p><p>	</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:125px 0px 0px 10px; margin:0px; letter-spacing:3px;\">	USB 3</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:15px 0px 0px 10px; margin:0px; width:365px; text-indent:28px;\">	将你的打印机、数码相机、手机和外置硬盘通通拿出来都不在话下。 每台 iMac 都配有 4 个 USB 3 端口，传输速度高达 USB 2 的 10 倍，让你可以连接 iPhone 或 iPod、打印机或 Apple USB SuperDrive 光驱等各式各样的外设。USB 3\n端口也可与你的 USB 2 设备充分兼容。</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:145px 0px 0px 10px; margin:0px; letter-spacing:3px;\">	蓝牙</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:15px 0px 0px 10px; margin:0px; width:350px; text-indent:28px;\">	iMac 内置蓝牙 4.0 无线技术，开箱即用， 让你可以方便地使用 Apple Wireless Keyboard 和 Magic Mouse 等各种你喜爱的无线配件。</p><p>	</p><p>	</p><p>	</p><p>	</p><p style=\"padding:0px; margin:0px; text-align:center;\">	<img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140709172733853.jpg\"/></p><p>	</p><p>	</p><p>	</p><p style=\"font-size:45px; line-height:65px; text-align:center; padding:50px 0px 0px 0px; margin:0px; letter-spacing:3px;\">	音响和画面，<br/>	一清二楚，有声有色。</p><p>	</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:60px 0px 0px 10px; margin:0px; letter-spacing:3px;\">	音色更逼真，<br/>	音场更磅礴。</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:15px 0px 0px 10px; margin:0px; width:230px;\">	虽然 iMac 的外壳边缘仅薄至 5 毫米，但内置扬声器仍能提供高保真音质。 因此，你在聆听新的专辑、观看热门大片或在喜爱的动作类游戏中酣战时，将体验到震撼的环绕音效和惊艳的宽广声场。</p><p>	</p><p>	</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:60px 0px 0px 10px; margin:0px; letter-spacing:3px;\">	双麦克风，<br/>	声声入耳。</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:15px 0px 0px 10px; margin:0px; width:230px;\">	iMac 配有两个内置麦克风，可相互配合精确定位你的语音， 并过滤掉你周围的杂音。这意味着，使用听写功能时，准确度将提高；进行 FaceTime 视频通话时，通话质量将更清晰。</p><p>	</p><p>	</p><p>	</p><p style=\"font-size:25px; line-height:35px; padding:60px 0px 0px 10px; margin:0px;\">	FaceTime HD 高清摄像头呈现高精度视频通话。</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:15px 10px 0px 10px; margin:0px; width:290px;\">	宽屏 HD 高清视频技术，让画面中的每个人都鲜明生动。 内置的 720p FaceTime HD\n高清摄像头令你的视频通话如此清晰，仿佛所有人都正同处一室。 使用 iMac，即可与支持 FaceTime 的 Mac、iPhone、iPad 或 iPod touch 进行 FaceTime 视频通话。</p><p>	</p><p>	</p><p>	</p><p>	&nbsp;</p><p>	</p><p>	</p><p style=\" padding:0px; margin:0px; text-align:center;\">	<img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140709172759930.jpg\"/></p><p>	</p><p>	</p><p>	</p><p style=\"font-size:40px; line-height:65px; padding:50px 0px 0px 0px; margin:0px; text-align:center; letter-spacing:3px;\">	无线的 Magic Mouse 或 Magic Trackpad，Multi-Touch 有两招。</p><p>	</p><p style=\"font-size:14px; line-height:25px; padding:80px 0px 0px 30px; margin:0px; width:430px; text-indent:28px;\">	选择令你称心的无线装备。使用 iMac 标配的 Magic\nMouse，你可以在平滑、无缝的顶盖上执行简单的手势操作。使用单指可在任意方向上滚动， 双指轻扫可浏览网页和照片，还可随处轻点和双击。或者选择\nMagic Trackpad，它拥有易于触控的全玻璃表面， 是 Apple 制造的最大的 Multi-Touch\n触控板。因此，你有充足空间进行滚动、轻扫、双指开合、旋转和其他操作。</p><p>	</p><p>	</p><p>	</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:130px; float:left; padding:240px 0px 0px 50px; margin:0px;\">	<strong>轻点</strong><br/>	随处轻点或双击。整个表面即是按键。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:130px; float:left; padding:240px 0px 0px 30px; margin:0px;\">	<strong>双键点击</strong><br/>	在系统偏好设置中设定双键点击 (右击)。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:120px; float:left; padding:240px 0px 0px 30px; margin:0px;\">	<strong>360° 滚动</strong><br/>	以单指滚动来实现横向和纵向移动。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:130px; float:left; padding:240px 0px 0px 30px; margin:0px;\">	<strong>屏幕缩放</strong><br/>	按住控制键，以单指滚动来缩放屏幕。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:120px; float:left; padding:240px 0px 0px 30px; margin:0px;\">	<strong>双指轻扫</strong><br/>	双指向左、右轻扫，以便在 Safari 中前后翻页。</p><p>	</p><p>	</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:180px; float:left; padding:280px 0px 0px 20px; margin:0px;\">	<strong>轻点</strong><br/>	在 Multi-Touch 表面随处点按，可实现轻点操作。或在系统偏好设置中启用 &quot;轻拍点按&quot;，只要轻拍触控板即可进行同样的操作。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:180px; float:left; padding:280px 0px 0px 30px; margin:0px;\">	<strong>旋转</strong><br/>	将拇指和食指置于 Multi-Touch 表面，顺时针或逆时针转动双指即可旋转图片。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:190px; float:left; padding:280px 0px 0px 20px; margin:0px;\">	<strong>四指轻扫实现 Exposé</strong><br/>	使用四指沿 Multi-Touch 表面向下轻刷，即可平铺显示所有已开启的窗口。向上轻刷手指，可将所有窗口推向旁边，便于你快速访问桌面。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:130px; float:left; padding:280px 0px 0px 45px; margin:0px;\">	<strong>三指轻扫导航</strong><br/>	使用三个手指，左右轻刷 Multi-Touch 表面前后翻页。</p><p>	</p><p>	</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:185px; float:left; padding:260px 0px 0px 20px; margin:0px;\">	<strong>双指滚动</strong><br/>	在 Multi-Touch 表面轻刷双指，即可沿着纵向、横向或对角线等任何方向滚动操作。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:180px; float:left; padding:260px 0px 0px 20px; margin:0px;\">	<strong>双指开合缩放</strong><br/>	开合双指以放大和缩小照片，放大网页中的字号，还可进行更多操作。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:190px; float:left; padding:260px 0px 0px 30px; margin:0px;\">	<strong>双击</strong><br/>	在 Multi-Touch 表面随处点按两次，可实现双击操作。 或在系统偏好设置中启用 &quot;轻拍点按&quot;，只要轻拍触控板两次即可进行同样的操作。</p><p>	</p><p style=\"font-size:14px; line-height:22px; width:140px; float:left; padding:260px 0px 0px 30px; margin:0px;\">	<strong>辅助点按/轻拍</strong><br/>	点击触控板一角或双指随处点按，即可执行右键点按功能。启用 &quot;轻拍点按&quot; 之后，随处轻拍双指即可进行同样的操作。</p><p>	</p><p>	</p><p>	</p><p>	</p><p style=\"font-size:40px; line-height:65px; padding:50px 0px 0px 0px; margin:0px; text-align:center; letter-spacing:3px;\">	了不起的<br/>	先进操作系统</p><p>	</p><p style=\"font-size:15px; line-height:25px; padding:10px 30px 0px 30px; margin:0px; text-align:center;\">	你的 Mac 之所以如此直观易用，OS X 功不可没。<br/>	它专为 Mac 而打造，带给你一个密切整合的系统，让一切都配合得天衣无缝。<br/>	OS X 让每台 Mac 内蕴藏的强大技术得以充分发挥。而且，得益于 iCloud，OS X 使你的 Mac、iPhone、iPad 和 iPod touch 可以彼此默契配合。</p><p>	</p><p style=\" padding-top:30px; margin:0px; text-align:center;\">	<img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140709172842265.jpg\"/></p><p>	</p><p>	</p><p>	</p><p style=\"font-size:40px; line-height:65px; padding:50px 0px 0px 0px; margin:0px; text-align:center; letter-spacing:3px;\">	一系列强大的内置 App，<br/>	从生产力到创造力，无不得力。</p><p>	</p><p style=\"font-size:15px; line-height:25px; padding:10px 30px 0px 30px; margin:0px; text-align:center;\">	iMac 配备 iPhoto、iMovie、GarageBand、Pages、Numbers 及 Keynote。<br/>	这样，你可以随时使用你的照片、视频、音乐、文档、电子表格和演示文稿来演绎无限创意。你还可以获得各种出色 app 来发送电子邮件、 管理日程安排和自动备份你的 Mac，甚至还有一款 app 可以让你在 Mac App Store 购买新 app。</p><p>	</p><p style=\" padding-top:30px; margin:0px; text-align:center;\">	<img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140709172848237.jpg\"/></p><p>	</p><p>	</p><p>	</p><p style=\"font-size:40px; line-height:65px; padding:50px 0px 0px 0px; margin:0px; text-align:center; letter-spacing:3px;\">	iCloud， 你 iMac 上的一切挚爱，<br/>	现身你所有的设备。</p><p>	</p><p style=\"font-size:15px; line-height:25px; padding:10px 30px 0px 30px; margin:0px; text-align:center;\">	iCloud 可以存放你的内容，并让你无论使用什么设备，<br/>	都能轻松访问照片、日历、联系人、文档和更多内容。 所以，无论你是使用 iPhone 拍摄了精彩的照片，或是在 iPad 上更改了会议安排，iCloud 都将保证所有这一切也同样出现在你的 Mac 上。</p><p>	</p><p style=\" padding-top:30px; margin:0px; text-align:center;\">	<img src=\"http://goodsimg.1yyg.com/GoodsInfo/20140709172855818.jpg\"/></p><p>	</p><p>	</p><p>	</p><p style=\"font-size:18px; line-height:25px; padding:20px 0 10px 0px; margin:0px;\">	重要说明：</p><p>	</p><p style=\"font-size:14px; line-height